Boguszyce Małe is a &lt;a href="village"&gt;village&lt;/a&gt; in the administrative district of &lt;a href="Gmina%20Rawa%20Mazowiecka"&gt;Gmina Rawa Mazowiecka&lt;/a&gt;, within &lt;a href="Rawa%20County"&gt;Rawa County&lt;/a&gt;, &lt;a href="%C5%81%C3%B3d%C5%BA%20Voivodeship"&gt;Łódź Voivodeship&lt;/a&gt;, in central Poland. It lies approximately south-west of &lt;a href="Rawa%20Mazowiecka"&gt;Rawa Mazowiecka&lt;/a&gt; and east of the regional capital &lt;a href="%C5%81%C3%B3d%C5%BA"&gt;Łódź&lt;/a&gt;.
